function adminDash_js() {
    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilegrid_7': 'adminDash_mobilegrid_7',
        'mobilegridcell_8': 'adminDash_mobilegridcell_8',
        'mobilebutton_12': 'adminDash_mobilebutton_12',
        'mobilegridcell_9': 'adminDash_mobilegridcell_9',
        'mobilelabel_13': 'adminDash_mobilelabel_13',
        'mobilebutton_2': 'adminDash_mobilebutton_2',
        'mobilebutton_5': 'adminDash_mobilebutton_5',
        'mobilebutton_6': 'adminDash_mobilebutton_6',
        'feedback_button': 'adminDash_feedback_button',
        'foodStoreAccess_button': 'adminDash_foodStoreAccess_button',
        'mobilebutton_14': 'adminDash_mobilebutton_14'
    };
    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }
    /*
     * Nonvisual components
     */
    Apperyio.mappings = Apperyio.mappings || {};
    Apperyio.datasources = Apperyio.datasources || {};
    Apperyio.CurrentScreen = 'adminDash';
    _.chain(Apperyio.mappings)
        .filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        })
        .each(Apperyio.UIHandler.hideTemplateComponents);
    /*
     * Events and handlers
     */
    // On Load
    var adminDash_onLoad = function() {
        adminDash_elementsExtraJS();
        $('div[dsid="mobilecontainer"]').css('background-image',
            'url(' + Appery.getImagePath('Artboard_1.png') + ')');
        $('div[dsid="mobilecontainer"]').css('background-size', '100% auto');
        $('div[dsid="mobilecontainer"]').css('background-color', '#ffffff');
        $('div[dsid="mobilecontainer"]').css('background-position', 'center');
        $('div[dsid="mobilecontainer"]').css('background-repeat', 'no-repeat');
        $('div[dsid="mobilecontainer"]').css('background-position', 'top');
        ;
        adminDash_deviceEvents();
        adminDash_windowEvents();
        adminDash_elementsEvents();
    };
    // screen window events
    function adminDash_windowEvents() {
        $('#adminDash').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });
    };
    // device events
    function adminDash_deviceEvents() {
        document.addEventListener("deviceready", function() {
        });
    };
    // screen elements extra js
    function adminDash_elementsExtraJS() {
        // screen (adminDash) extra code
    };
    // screen elements handler
    function adminDash_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });
        $(document).off("click", '#adminDash_mobilecontainer [name="mobilebutton_12"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Home', {
                        transition: 'slide',
                        reverse: true
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="mobilebutton_12"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="mobilebutton_2"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('adminCheckAttendance', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="mobilebutton_2"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="mobilebutton_5"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('searchPodEvaluations', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="mobilebutton_5"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="mobilebutton_6"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('paymentHistories', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="mobilebutton_6"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="feedback_button"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('AdminFeedback', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="feedback_button"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="foodStoreAccess_button"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('foodStoreAccess', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="foodStoreAccess_button"]');
        $(document).off("click", '#adminDash_mobilecontainer [name="mobilebutton_14"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('orderDisplay_food', {
                        reverse: false
                    });
                }
            },
        }, '#adminDash_mobilecontainer [name="mobilebutton_14"]');
    };
    $(document).off("pagebeforeshow", "#adminDash").on("pagebeforeshow", "#adminDash", function(event, ui) {
        Apperyio.CurrentScreen = "adminDash";
        _.chain(Apperyio.mappings)
            .filter(function(m) {
                return m.homeScreen === Apperyio.CurrentScreen;
            })
            .each(Apperyio.UIHandler.hideTemplateComponents);
    });
    adminDash_onLoad();
};
$(document).off("pagecreate", "#adminDash").on("pagecreate", "#adminDash", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    adminDash_js();
});